import { UITextBoxView } from "@realmocean/inputs"
import { cTopLeading, HStack, Icon, RequiredRule, Text, TextAlignment, TextField, VDivider, VStack } from "@tuval/forms"
import { Views } from "../../../Views/Views"

const Infobox = (info: string) => (
    HStack({ spacing: 10 })(
        VDivider().width(2).background('rgb(0,165,194)'),
        HStack({ alignment: cTopLeading })(
            Icon('\\e88e').size(24).foregroundColor('rgb(0,165,194)')
        ).width(),
        Text(info).multilineTextAlignment(TextAlignment.leading)
    )
        .height()
        .padding(12)
        .border('solid 1px hsl(232 21% 93%)')
        .background('rgb(250, 250, 255)')
)

